import React, {Component} from 'react'

class App extends Component {
    render() {
        return (
            <div className='text-center' style={{
                color:'green',
                fontSize: '35px'
                }}>
                <div>
                  <h>DEFI STAKING APP</h>
                </div>
                <div>
                  World of Decentralization!
                </div>
            </div>
        )
    }
}

export default App;
